import React, {Suspense} from 'react';
import {render} from 'react-dom';
import Routes from './Routes';
import Loader from 'react-loader-spinner';
// import './i18n';
// import serviceWorker from './serviceWorker'

render(
    <Suspense>
      <Routes />
    </Suspense>,
    document.getElementById('root'),
);

